  let tablaSeries : HTMLElement = document.getElementById("tablaSeries")!;
  let promedioTable : HTMLElement = document.getElementById("Promedio")!;
    showtable(series);
    showpromSerie(series);

  function showtable (serieP: Serie[]): void{
    let tbodySerie = document.createElement("tbody");
    for (let serie of serieP){
        let trSerie: HTMLElement = document.createElement("tr");
        trSerie.innerHTML = ` <td>${serie.id}</td>
        <td><a href = "#">${serie.title}</a></td>
        <td>${serie.canal}</td>
        <td>${serie.temporadas}</td>`;
        tbodySerie.appendChild(trSerie);

        const card: HTMLElement | null = document.querySelector('#info');
        const show: HTMLElement | null = trSerie.querySelector('a');
        if (show){
          show.addEventListener('click', () => {
              if (card) {
                  card.innerHTML = `<div class="card">
                                      <img class="card-img-top" src="${serie.image}" alt="${serie.title} picture">
                                      <div class="card-body">
                                          <h5 class="card-title">${serie.title}</h5>
                                          <p class="card-text">${serie.dp}</p>
                                          <a href="${serie.linkinfo}" target="_blank">${serie.linkinfo}</a>
                                      </div>
                                  </div>`;
          }});
          tablaSeries.appendChild(trSerie);
    }
    tablaSeries.appendChild(tbodySerie);
  }}

  function promSerie (serieP: Serie[]): number{
    let promedio: number = 0;
    for (let serie of serieP){
        promedio += serie.temporadas;
    }
    return promedio/serieP.length;
  }

  function showpromSerie (serieP: Serie[]): void{
    let promedio: number = promSerie(serieP);
    let x : HTMLElement = document.createElement("tr");
    x.innerHTML = `<td><b>Seasons Average</b></td>
    <td>${promedio}</td>`;
    promedioTable.appendChild(x);
  }